<h3 class="articletitle">Tikeer</h3>
Tikeer is a rough satin burgundy sedimentary rock Tikeer's properties are entirly mundane and is uniquly useful in carpentry. Tikeer was first discovered by the carpenter <a href="../people/Iorthosselczg9ir8jbw.html">Iorthossel</a> within the <a href="../localregions/GlijijdrasumoMoor.html">Glijijdrasumo Moor</a> durring the late 12th century in summer of the year 1176.
